import React, { useState, useEffect } from "react";

function App() {
  const [organization, setorganization] = useState(0);
  const [network, setnetwork] = useState(0);

  useEffect(() => {
    fetch("/organizations")
      .then((res) => res.json())
      .then((organizations) => {
        setorganization(organizations.organizations[0].name);
      });
  }, []);

  useEffect(() => {
    fetch("/networks")
      .then((res) => res.json())
      .then((network) => {
        setnetwork(network.networks[0].name);
      });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>The current Organization is {organization}.</p>
        <p>
          Networks in {organization}: {network}.
        </p>
      </header>
    </div>
  );
}

export default App;
